INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("春咲 ひより", 1, 2, "お！\nあそこに困ってそうな人発見！", 0, 1, 1.4, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", 1, 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 0, 0, 1001, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("草野 優衣", 1, 2, "大切な人を\n守れるようになりたい…って", 0, 1, 1.4, "わ、わたし、\nなに言ってるんだろ\nあはは…", 1, 0, "みんなみたいに\nわたしも強くならなきゃ", 0, 0, 1002, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("士条 怜", 1, 2, "キミに必要な集中力と感性が", 0, 1, 1.4, "少しは磨かれると思いますよ。", 1, 0, "フェンシングを始めてみては？", 0, 0, 1003, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("穂高 みそぎ", 1, 2, "今日はなにして遊ぶ？", 0, 1, 1.5, "みそぎはねぇ、\nかくれんぼやりたい！", 1, 0, "ねぇ、にいちゃん！", 0, 0, 1004, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("風宮 あかり", 1, 2, "ねぇ…", 0, 1, 1.4, "私といっしょに…\nいかない？", 1, 0, "風宮あかりです", 0, 0, 1006, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("出雲 宮子", 1, 2, "プリンたべたいのー", 0, 1, 1.5, "食べ物の恨みは怖いのー", 1, 0, "出雲宮子なのー", 0, 0, 1007, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("虹村 雪", 1, 2, "キミもボクの美貌に\n吸い寄せられたんだね。", 0, 1, 1.4, "いいよ。\n見られることは運命さ…", 1, 0, "ボクは虹村雪。", 0, 0, 1008, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("柊杏奈", 1, 2, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 0, 1, 1.4, "人呼んで「疾風の冥姫」!!", 1, 0, "フッ…聞いて後悔するがいい！", 0, 0, 1009, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("姫宮 真歩", 1, 2, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 0, 1, 1.5, "ほんまおおきにやわ～♪", 1, 0, "マホマホ王国のプリンセス、\nまほ姫どす", 0, 0, 1010, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("衣之咲 璃乃", 1, 2, "生き別れたお兄ちゃんを探して\n三千世界！", 0, 1, 1.4, "ここで会ったが\n100年目～！", 1, 0, "衣之咲璃乃です！", 0, 0, 1011, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("柏崎 初音", 1, 2, "ち、超能力って…\n何のことかな～？", 0, 1, 1.4, "…って、お願い！\n誰にも言わないでおいて～！", 1, 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 0, 0, 1012, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("美波 鈴奈", 1, 2, "一応カリスマ読モJKやってまっす！", 0, 1, 1.4, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", 1, 0, "ちょす！\n美波鈴奈だよ～♪", 0, 0, 1016, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("喜屋武 香織", 1, 2, "東京は遊園地みたいなところさー", 0, 1, 1.4, "でも、沖縄もとってもいいとこさー", 1, 0, "はいたーい。\n喜屋武香織さー。", 0, 0, 1017, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("支倉 伊緒", 1, 2, "先生って呼ばれるのは\nくすぐったいから", 0, 1, 1.4, "イオちゃんって呼んでね。", 1, 0, "支倉伊緒です。", 0, 0, 1018, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("茜 ミミ", 1, 2, "あ！/\お兄ちゃ～ん\nまってよ～", 0, 1, 1.5, "ミミをおいてかないでぇ～", 1, 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 0, 0, 1020, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("栗林 くるみ", 1, 2, "あの……\nふぇ……", 0, 1, 1.5, "ふぇぇぇぇぇん……", 1, 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 0, 0, 1021, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("風宮 より", 1, 2, "こんな私に貴重な時間を\n割いていただき、", 0, 1, 1.4, "なんてありがとうございます！", 1, 0, "風宮よりです。\nあああああ！", 0, 0, 1022, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("北条 綾音", 1, 2, "おにいちゃんどこいくの？\nえ？", 0, 1, 1.5, "私こっち行きたいー\nね、早く早くー", 1, 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 0, 0, 1023, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("天野 すずめ", 1, 2, "ふ、不束者ですが\nどうぞ末永く…って、", 0, 1, 1.4, "これて何か違う…\nあああすみません！", 1, 0, "わっ…わっ…私、\n天野すずめといいます！", 0, 0, 1025, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("倉石 恵理子", 1, 2, "あなたは…運命の……\n伴侶……", 0, 1, 1.4, "離しませんわ………\n絶対に…!!", 1, 0, "……クスクス…私は\n…倉石恵理子……", 0, 0, 1027, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("佐々木 咲恋", 1, 2, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 0, 1, 1.4, "…そうでしょ？？", 1, 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 0, 0, 1028, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("桜井 望", 1, 2, "ぇっと…\nキミ、私のこと知らないの?!", 0, 1, 1.4, "あはは、\n私もまだまだだなぁ～", 1, 0, "桜井望だよ！\nよろしくねっ", 0, 0, 1029, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("ニノン・ジュベール", 1, 2, "初めまして、\n私はニノン・ジュベール申すデス！", 0, 1, 1.4, "ショーグン、\nワタシと一緒に天下統一デース！", 1, 0, "デケデケデンっ！", 0, 0, 1030, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("上喜 しのぶ", 1, 2, "でもって私の隣にいるのが……\nえ、見えない？", 0, 1, 1.4, "おかしいですね……", 1, 0, "上喜しのぶです。\n手元のドクロが父です。", 0, 0, 1031, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("野戸まひる", 1, 2, "けんども\nそれには足りないモンが…", 0, 1, 1.5, "そう、\nオラのボケに突っ込める相方が…！", 1, 0, "目指すはビッグな\nお笑い芸人だっぺ！", 0, 0, 1033, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("綾瀬 ゆかり", 1, 2, "ちょっと緊張しちゃって…", 0, 1, 1.4, "ちょ\nちょっと一杯飲んできます…！", 1, 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 0, 0, 1034, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("氷川 鏡華", 1, 2, "知らない人とは話しちゃいけないので", 0, 1, 1.5, "これ以上お話しすることは…\nないです！", 1, 0, "氷川鏡華…です", 0, 0, 1036, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("柏崎 栞", 1, 2, "……あ、アラーム。", 0, 1, 1.4, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", 1, 0, "柏崎…栞です。", 0, 0, 1038, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("双葉 碧", 1, 2, "私、一人も友達がいなくて……", 0, 1, 1.4, "野に咲く花が、\n唯一の話相手です。", 1, 0, "ふ、双葉碧です。", 0, 0, 1040, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("三角 千歌", 1, 2, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 0, 1, 1.4, "そう思っています。", 1, 0, "三角千歌です。", 0, 0, 1042, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("安芸 真琴", 1, 2, "あぁ？\nお前のそいつの仲間か？", 0, 1, 1.4, "う、疑ってすまなかったな…", 1, 0, "安芸真琴だ。", 0, 0, 1043, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("イリヤ・オーンスタイン", 1, 2, "生けとし生ける全ての者よ！", 0, 1, 1.4, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", 1, 0, "わらわこそは夜を総べる者！", 0, 0, 1044, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("遠見 空花", 1, 2, "ぐふふふふ……はっ！", 0, 1, 1.4, "ｌク、クウカに何かご用ですか!?", 1, 0, "そこで騎士は妖精を乱暴に……", 0, 0, 1045, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("宮坂たまき", 1, 2, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 0, 1, 1.4, "う～ん…\n猫ってホントに最高にゃ～♪", 1, 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 0, 0, 1046, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("大神 美冬", 1, 2, "それでは早速クエストに…", 0, 1, 1.4, "…と思ったら\nバイトの時間だ！\nまたあとでね！", 1, 0, "大神美冬よ！", 0, 0, 1048, 0);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES ("星野静流", 1, 2, "クエストもバトルも\n掃除も洗濯も", 0, 1, 1.4, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", 1, 0, "星野静流だよ！", 0, 0, 1049, 0);
